import React from 'react';
import PropTypes from 'prop-types';
import withStyles from '@material-ui/core/styles/withStyles';
import Login from './LogIn'


const styles = theme => ({
    backgroundBox: {
        position: 'fixed',
        top: '0',
        left: '0',
        width: '100vw',
        height: '100vh',
        // backgroundImage: 'url(https://github.com/zhangZhiHao1996/image-store/blob/master/react-admin-master/bg5.jpg?raw=true)',
        backgroundImage: 'url(https://github.com/zhangZhiHao1996/image-store/blob/master/react-admin-master/bg1.jpg?raw=true)',
        backgroundSize: '100% 100%',
        transition: 'all .5s'
    },
    loginBox: {
        backgroundColor: 'rgba(178,178,178,0.0)',
    },
});

class LoginPage extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        const {classes} = this.props;
        return (
            <div id='login-page'>
                <div id='bg-image' className={classes.backgroundBox} />
                <div className={classes.loginBox} >
                    2234
                    <Login />
                </div>
            </div>
        );
    }
}

LoginPage.propTypes = {
    classes: PropTypes.object.isRequired,
};

LoginPage.contextTypes = {
    router: PropTypes.object.isRequired
};

export default withStyles(styles)(LoginPage);
